    let[parentState,serParentState]=useState<IState>({
        pMessage : 'Hello Iam from Parent',
        childMessage : ''
    });
     let receiveData = (value:string):void => {
        serParentState({
            ...parentState,
            childMessage : value
        });
    };

    return(
        <React.Fragment>
            <h2> ParentComponent Components</h2>

        </React.Fragment>
    )
};
